(defn parse-input
  [input]
  (map #(clojure.string/split % #"\)")
       (clojure.string/split-lines input)))

(defn build-graph
  [edges graph]
  (if (empty? edges)
    graph
    (let [[first second] (first edges)]
      (build-graph
        (rest edges)
        (merge-with into graph {first [second]} {second [first]})))))

(defn dfs-search
  [graph start-node finish-node visited count]
  (if (.equals start-node finish-node)
    count
    (let [vertices (get graph start-node [])]
      (if (or (empty? vertices) (contains? visited start-node))
        Integer/MAX_VALUE
        (reduce min
                (map #(dfs-search
                        graph
                        %
                        finish-node
                        (conj visited start-node)
                        (inc count))
                     vertices))))))

(let [graph (build-graph (parse-input my-test) {})]
  (dfs-search graph "YOU" "SAN" #{} -2))


